import { faShoppingCart } from '@fortawesome/free-solid-svg-icons'

function Home() {
    return (
        <View style={{ flex: 1 }}>
          <View style={{flex:2,flexDirection:'row', justifyContent:'center'}}>
          <CustomSearchBar/>
          <FontAwesomeIcon icon={faShoppingCart} color="#E49012" size={30} />
         </View>

      </View>
    )
}

export default Home
